import Link from 'react-router-dom';
import Button from 'react-bootstrap';

function OurTeam() {
    return (
        <div>
            <p>Our Team</p>
            <Link to='/'><Button>Portal</Button></Link>
            <Link to='/home'><Button>Home</Button></Link>
        </div>
    )
}

export default OurTeam;
